height : 300px;
width : 100%;
border-radius: 10px;
`
const P1 = styled.p`
margin : 20px;
color: #777777;
font-size: 18px;
`
const P2 = styled.p`
margin : 0 18px;
font-size: 14px;
`
const Button = styled.button`
display: block;
height: 20%px;
width: 40%;
line-height: 25px;
font-size: 18px;
color: #ffffff;
font-weight: bold;
text-decoration: none;
background-color: #d41f1f;
cursor: pointer;

margin : 20px;
border : none;
border-radius : 10px;
`

