          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
          <MealsDiv></MealsDiv>
        </Card>
      </MealdealContainer>
    <Footer />
  </Container>
  )
}

export default MealDeal
